@shifty71 covered Merle Haggard’s “Ramblin’ Fever” in a recent session with us at @3sirens and reflected on the role of country music in Southern California—from Gene Autry and televised westerns to the Bakersfield Sound, Buck Owens, and @merlehaggardofficial, and on through to Gram Parsons. The sound of West Coast country was always around him, but he didn’t realize its real impact until later in life.

Check out the full session, which also features an in-studio version of “Overboard” from Chris’ forthcoming record ‘Lost at Sea,’ on YouTube via @contrarywestern.

