📣 CHRIS SHIFLETT TOMBOY SESSION IS LIVE! 📣🤠 Happy #tomboytuesday y’all! @shifty71 has done it all from sweaty punk rock clubs to sold out stadiums! When he’s not playing guitar in the Foo Fighters, he’s making good ol’ fashioned Americana music in his solo project. We spent a nice Saturday afternoon with Chris and his band at Tomboy where he recorded a cool, stripped down version of “Dead And Gone” off of his brand new record Lost At Sea, and we’re sure excited to finally share it with y’all!

🔗 Just tap the link in our bio to check it the FULL VIDEO out on The Tomboy Sessions YouTube channel. 

